import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Redirect,
} from "react-router-dom";

import Home from './app/Home/Home';
import LandingPage from './app/Login/LandingPage';

function App(props) {
    
    return (
        <>
            {/* <LoadingBar style={{ background: "#E5017D", zIndex: 99, position: "fixed"}} /> */}
            <Router>
                <Switch>

                    <Route path="/home">
                        <Home />
                    </Route>
                    
                    <Route path="/">
                        <LandingPage />
                    </Route>
                </Switch>
            </Router>
        </>
    )
}

export default App;
